@EU_Commission Para empezar, reconoced mi voto y los de màs de 2 millones de ciudadanos de la UE.
Poco podemos fiarnos de ustedes si nos niegan este derecho fundamental. 
Lejos quedan los valores fundacionales, són un fraude de institución.

@EU_Commission Con voi siamo in dittatura.

Ci siamo chiusi in gabbia e abbiamo buttato via la chiave. 
(cit. C. Galli)

@EU_Commission Are you awake?This is 4th day!!! Why you don't say anything about Iranian protesters?!100s of people are killed. They don't have any internet connection, they don't have any voice. Where is human rights? Where is democracy?
#IranPortests 
#FreeIran

@EU_Commission Please, could you advice me how must I do in order I could have my MEPs sat in the EU parliament?
Please don't feel offended. I am an unfortunate European. I have had the boldness to write and I know I shouldn't. Please forgive me, I am so sorry.
I am Catalan. So I have no rights
